        uint256 fee = (totalAmount * 2) / 100; // fee is 2%
        _sendValue(feeAddress, fee);
        _transfer(seller, totalAmount - fee);
    }

    function _closeSellOfferFor(IERC721 nft, uint256 tokenId) internal {
        uint256 id = tokenSellOffers[nft][tokenId];
